import E_Board from '../components/TeamCards/E_board';
import '../styles/Home.css';

function Team() {
    const classes = useStyles();
    return (
        <div className="team">
            <h1>E-Board Members</h1>
            <E_Board/>
            <h1>Vice Presidents</h1>
            <E_Board/>
            <h1>Tech Team</h1>
            <E_Board/>
        </div>
    )
}

export default Team
